def tem_city(dfc):
        column_names = ['CodeComment',	'CodeMaghta',	'shenase',	'KarbarName',	'SoalPasokh',	'Comment',	'Tarikh',	'Codejavab','saateersal',	'Shomarande']
        fi = pd.DataFrame(columns = column_names)
        fi['CodeComment']=dfc['آیدی کامنت']
        fi['Comment']=dfc['متن کامنت']
        fi['CodeMaghta']=dfc['لینک مطلب']
        fi['KarbarName']=dfc['نام کامنت گذار']
        fi['Tarikh']=dfc['تاریخ کامنت']
        fi['Codejavab']=dfc['پاسخ به']
        fi['saateersal']=dfc['ساعت ارسال کامنت']
        fi['Shomarande']=dfc['شمارنده']
        dfc.sort_values(by=['تاریخ کامنت'])
        for i in range(len(dfc)):
            if dfc["پاسخ به"][i]>1:
                fi['shenase'][i]=dfc["پاسخ به"][i]
                fi['SoalPasokh'][i]='پاسخ کامنت'
            else:
                fi['SoalPasokh'][i]='کامنت'
                fi['shenase'][i]=fi['CodeComment'][i]
        fi=fi.sort_values(by=['shenase'])    
        return fi
