def dict_gram(df):
    df.insert(6, 'trend', 'unknown')
    tren=df
    u=0
    mm=0
    m_=0
    for i in range(len((tren["trend"]))):
        
        if i<(len((tren["trend"])))/5 and u<1:
            u=u+1
            progress['value']=10
            root.update_idletasks()            
            
        if (len((tren["trend"])))/4>i>(len((tren["trend"])))/5 and u<2:
            u=u+1
            progress['value']=30
            root.update_idletasks()
            
        if (len((tren["trend"])))/2>i>(len((tren["trend"])))/4 and u<3:
            u=u+1
            progress['value']=50
            root.update_idletasks()
        
        if 3*(len((tren["trend"])))/4>i>(len((tren["trend"])))/2 and u<4:
            u=u+1
            progress['value']=80
            root.update_idletasks()
        
        if (len((tren["trend"])))>i>3.9*(len((tren["trend"])))/4 and u<5:
            u=u+1
            progress['value']=90
            root.update_idletasks()
            
            
        m = 0
        d = 0
        k = 0
        d_m = 0
        k_m = 0
        m_m = 0
        s=0
        s_=0
        if tren['trend'][i] == 'unknown':
            n = len(tren.loc[tren['shenase'] == tren['shenase'][i]])
            for j in range(n):
                ddg = tren['Comment'][i + j]
                m += sum(map(ddg.count, mosh))
                d += sum(map(ddg.count, dars))
                k += sum(map(ddg.count, khad))
                d_m += sum(map(ddg.count, mono_dars))
                m_m += sum(map(ddg.count, mono_khad))
                k_m += sum(map(ddg.count, mono_mosh))

            s_=k_m+d_m+m_m
            s=m+d+k
            ########################3
            if d_m >  1.3*k_m + 1.8*m_m:
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "درسی"
                continue
            if d >  1.4*k +  1.8*m:
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "درسی"
                continue            
            if d > 1.2*k and d > 1.3*m:
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "درسی"
                continue  
            if m > 2*k and m > 1.8*d:
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "مشاوره"
                mm=mm+1
                print("mm=",mm)
                continue
            if k_m >(d_m +   2*m_m):
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "خدمات کانون"
                continue
            if m_m > (2*k_m +   d_m):
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "مشاوره"

                continue

            ####################
            if m_m > 2*k_m and m_m > 1.8*d_m:
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "مشاوره"

                continue
            if m >  (k +d):
                m_=m_+1
                print('m_',m_)
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "مشاوره"
                continue
            if k > 1.1*d and k > 1.3*m:
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "خدمات کانون"
                continue
            if k >(d +   2*m):
                tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "خدمات کانون"
                continue
            tren.loc[tren['shenase'] == tren['shenase'][i], ['trend']] = "0"
    return tren
