    def convert_csv_to_xls(self):
        try:
            self.file_name = filedialog.askopenfilename(initialdir='/Desktop',
                                                        title='Select a xlxs file',
                                                        filetypes=(('xlxs file', '*.xlsx'),
                                                                   ('xlxs file', '*.xlsx')))
            qr=1
            msg.showinfo('Please wait', 'Please wait')
            df2=tag_find(tem_city(pd.read_excel(self.file_name)),qr)   #tem_city
            # Next - Pandas DF to Excel file on disk
            if (len(df2) == 0):
                msg.showinfo('No Rows Selected', 'CSV has no rows')
            else:
                # saves in the current directory
                with pd.ExcelWriter('tag.xlsx') as writer:
                    df2.to_excel(writer, 'GFGSheet')
                    writer.save()
                    msg.showinfo('Excel file ceated', 'Excel File created')
        except FileNotFoundError as e:
            msg.showerror('Error in opening file', e)
